import React from 'react';

function Candy() {
    return (
        <div className="Candy">
        <h1>Candy</h1>
        <img
            src="./static/img/Nerds-Gummy.png"
            alt="Nerds Gummy Rainbow Clusters"
        />
        </div>
    );
}


export default Candy;
